Summary:
Hank treats a wound that will not heal;
Paige shares the condition for agreeing
to marry Evan.

While their wives are out of town, J.D.
and Turk attend a med student's party;
Kelso says goodbye to Ted and Gooch.

Rick and Carl find the farm in jeopardy;
the group is split up in the chaos;
Rick's leadership is questioned.

Michonne makes a decision about
Woodbury; Glenn and Maggie go on a run;
Rick struggles.

The Governor chases a fleeing dissenter;
while the Governor is gone, a traitor
tries to sabotage his plans.
